    {
        username: 'test',
        email: 'test@test.com',
        password: '1',
        phone: '1'
    }
];

export let currUser = [{
    username: '',
    email: '',
    password: '',
    phone: ''
}];

export function signUpUser(username, password, email, phone)
{
    allUsers.push({
        username: username,
        email: email,
        password: password,
        phone: phone
    })
}
